import React from 'react';



import Header from '../contact/header'
import Banner from '../contact/innerbanner'
import Footer from '../home/footer'
import Iosbanner from '.'

const Ios = () => {
    return (
        <div>
            
            <Header/>
            <Banner/>

            <Iosbanner/>
            <Footer/>
        </div>
    );
};

export default Ios;
